from math import gcd
from Crypto.PublicKey import RSA
from Crypto.Cipher import PKCS1_OAEP, AES
from icecream import ic

# Users
# username, rsa_key
# - All have e=65537, unique n and keysize of 2048
users = {}  # type: dict[str, RSA.RsaKey]
for username, rsa_key_hex in users_raw:
    key = RSA.import_key(bytes.fromhex(rsa_key_hex))
    assert key.e == 0x10001
    assert not any([k.n == key.n for k in users.values()])
    assert not key.has_private()
    users[username] = key

# Parameters
# id, encrypted_aes_key_for_initiator, encrypted_aes_key_for_peer, iv
# - both encrypted aes keys are 256 bytes, IV is 16 bytes
parameters = {}  # type: dict[int, tuple[bytes, bytes, bytes]]
for parameter_raw in parameters_raw:
    parameter = tuple(bytes.fromhex(h) for h in parameter_raw[1:])
    parameters[parameter_raw[0]] = parameter
    assert len(parameter[0]) == 256
    assert len(parameter[1]) == 256
    assert len(parameter[2]) == 16

# Conversations
# id, initiator, peer, initial_parameters
conversations = {}  # type: dict[int, tuple[str, str, int]]
for conversation_raw in conversations_raw:
    conversations[conversation_raw[0]] = conversation_raw[1:]

# Messages
# conversation, timestamp, from_initiator, next_parameters, encrypted_messages
messages = [] # type: list[tuple[int, int, bool, int, bytes]]
for message_raw in messages_raw:
    messages.append((
        message_raw[0],
        message_raw[1],
        bool(message_raw[2]),
        message_raw[3],
        bytes.fromhex(message_raw[4]),
    ))


